import React, { useEffect } from 'react';
import SignUpForm from './signupForm';
import Config from './config';
import SignInForm from './signinForm';

type Props = {
    auth: boolean,
    username: string|null|undefined,
    profilePicture: string|null|undefined,
    setUsername: any,
    setProfilePicture: any
}

const Profil: React.FC<Props> = ({ auth, username, setUsername, profilePicture, setProfilePicture }) => {

    useEffect(() => {
        document.getElementsByClassName('lateral')[0].classList.add('ouvert');
    }, []);

    console.log('Profil refresh');

    return (
        <div className="lateral profilContainer">
            <h2>PERFIL</h2>
            {auth ? <Config username={username} setUsername={setUsername} profilePicture={profilePicture} setProfilePicture={setProfilePicture} /> : <div><SignInForm /><SignUpForm /></div>}
        </div>
    );
}

export default Profil;
